function setClassNotNull() {
  const emailInput = document.getElementById('emailInput');
  emailInput.className === 'emailInput -notNull' ? emailInput.setAttribute('class', 'emailInput') : emailInput.setAttribute('class', 'emailInput -notNull');
}

export default setClassNotNull;
